import React, { useEffect } from 'react';
import { AppProviderWithRouter, AppContext } from "../context/AppContext";

const MyApp = (props,{ Component, pageProps }) => {

    useEffect(()=>{
        console.log( props)
    },[props ]);
    return (
        <AppProviderWithRouter>
            <Component { ...pageProps } />
        </AppProviderWithRouter>
    )

};
MyApp.getInitialProps = async ({pathname,query,req,res,err}) => {
    return { name: 'test' }
}
export default MyApp;
